function FormLogin(props) {
    const [name, setName] = useState("David")

    function handleSubmit(){
        alert('Submitted')
    }



    return (
        <div>
            <form onSubmit={handleSubmit}>
                <input type="text" value={name} />
                <input type="submit" />
            </form>
        </div>
    )
}

